### 代码

#### TypeScript实现 【一个栈实现】
```ts
class MyQueue {
    private arr: Number[]
    constructor() {
        this.arr  = []
    }

    push(x: number): void {
        this.arr.push(x)
    }

    pop(): number {
        const last = this.arr[0]
        this.arr.shift()
        // if (this.arr.length) return this.arr.pop() as number
        return last as number
    }

    peek(): number {
        return this.arr[0] as number
    }

    empty(): boolean {
        return this.arr.length == 0
    }
}
```

