思路： 
开始打算用一个 plus 变量表示要不要 +1， 后来发现space 和time 都肯定要大于 k的位数+ n， 就直接不管那个plus 了。 最后所有remining 都放在 num[0] 上面， 再统一转换成需要。 

由于 k 小于 1000， 所以实际 复杂度应该是： 
time = O（N） n 为num 长度
空间复杂度是1

class Solution:
    def addToArrayForm(self, num: List[int], k: int) -> List[int]:
        
        num[-1] += k 

        for i in range(len(num)-1, 0, -1): 
            if num[i] > 9:
                num[i-1] += num[i]//10
                num[i] = num[i]%10

        return [int(c) for c in str(num[0])] + num[1:]

这题看上去有点绕， 其实挺简单的。 就是需要想清楚情况。无非就是 backfill 或者 forward fill 两种。 想清楚两种情况酒容易多了。 
 
```python
class Solution:
    def shortestToChar(self, s: str, c: str) -> List[int]:
        res = [10**4+1] * len(s)
        idx_c = 10**4 * 3

        for idx, curr in enumerate(s): 
            if curr != c:
                res[idx] =  abs(idx_c - idx)
            else:
                idx_c = idx
                res[idx] = 0 
                # backfill
                j = idx -1 
                while j >= 0 and res[j] > abs(idx_c - j): 
                    res[j] = abs(idx_c - j)
                    j -= 1
        return res 
```
每个 value 最多遍历 2 次， 所以是 time complexity = O(N) , space complexity = O(N)

用两个stack， 一个 stackin   存储新来的， stackout 模拟queue。 
当stackout 空了， 就把所有stackin pop 再插入，相当于reverse 了。 

```python
class MyQueue:
    def __init__(self):
        self.stack_in =[]
        self.stack_out =[]
    
    def push(self, x: int) -> None:
        self.stack_in.append(x)

    def pop(self) -> int:
        if not self.stack_in and not self.stack_out:
            return None
        elif self.stack_out:
            return self.stack_out.pop()
        else:
            for i in range(len(self.stack_in)):
                self.stack_out.append(self.stack_in.pop())
            return self.stack_out.pop()

    def peek(self) -> int:
        ans = self.pop()
        self.stack_out.append(ans)        
        return ans

    def empty(self) -> bool:
        return not (self.stack_in or self.stack_out)
```
push: 新增时间复杂度 O(1)，新增空间复杂度 O(1) 
pop: 摊销时间复杂度 O(1) 因为所以元素最多进一次stack in 和一次 stack out，空间复杂度 O(1) 
peek: 时间复杂度 O(1)，空间复杂度 O(1) 
empty: 时间复杂度 O(1)，空间复杂度 O(1)

