### 思路

Loop twice, first record the distance from the left to the right. Then loop from the right to the left, and get the min value of the distance.


### 代码


```python
class Solution:
    def shortestToChar(self, s: str, c: str) -> List[int]:
        N = len(s)
        result = [N]*N
        position = float('inf')
        for i in range(N):
            if s[i]==c:
                result[i] = 0
                position = i
            else:
                result[i] = abs(position - i)
        for i in range(N-1,-1,-1):
            if s[i] == c:
                position = i
                result[i] = 0
            else:
                result[i] = min(result[i],abs(position -i))
        return result

```

**复杂度分析**
- 时间复杂度：O(N)，其中 N 为length of the string s。
- 空间复杂度：O(1)

### 思路

using two stacks, one is for push, the other is for pop and peek, if both empty, return true for empty.

### 代码


```python
class MyQueue:

    def __init__(self):
        self.MyQueue = []
        self.tempQueue = []

    def push(self, x: int) -> None:
        self.MyQueue.append(x)

    def pop(self) -> int:
        if not self.tempQueue:
            while self.MyQueue:
                self.tempQueue.append(self.MyQueue.pop())
        return self.tempQueue.pop()

    def peek(self) -> int:
        if not self.tempQueue:
            while self.MyQueue:
                self.tempQueue.append(self.MyQueue.pop())
        return self.tempQueue[-1]
    def empty(self) -> bool:
        return not self.tempQueue and not self.MyQueue


```

**复杂度分析**
- 时间复杂度：O(1)
- 空间复杂度：O(N)

