空间复杂度：O(n)

## 思路

记录上一个指定字符的下标，计算到上一个指定字符和当前指定字符的距离，取最小值，只有一个边界时直接计算距离

## 代码

```java
public static int[] shortestToChar2(String s, char c) {
    int[] in = new int[s.length()];
    // 上一个c的位置
    int l = -1;
    for (int i = 0; i < in.length; i++) {
        if (s.charAt(i) == c){
            if (l == -1){
                for (int j = l + 1; j < i; j++){
                    in[j] = i - j;
                }
            } else {
                for (int j = l + 1; j < i; j++){
                    in[j] = Math.min(j - l, i - j);
                }
            }
            l = i;
        }
    }
    if (l != in.length - 1){
        for (int i = 1; l + i < in.length; i++) {
            in[l + i] = i;
        }
    }
    return in;
}
```

