```java
class MyQueue {
        LinkedList<Integer> in = new LinkedList<>();
        LinkedList<Integer> out = new LinkedList<>();

        public MyQueue() {

        }

        public void push(int x) {
            in.push(x);
        }

        public int pop() {
            int2out();
            return out.pop();
        }

