## 思路
1. 先比較 array 的長度，比較長的前面補 0
2. 處理進位

## Code
```java
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        // converting k to digits
        int[] kDigits = Integer.toString(k).chars().map(c -> c - '0').toArray();

        // lengths
        int numLength = num.length;
        int kLength = kDigits.length;

        // Adjust lengths by adding zeros to the shorter array
        if (numLength > kLength) {
            // Prepend zeros to kDigits
            int[] adjustedKDigits = new int[numLength];
            int zeros = numLength - kLength;
            System.arraycopy(kDigits, 0, adjustedKDigits, zeros, kLength);
            kDigits = adjustedKDigits;
        } else {
            int[] adjustedNum = new int[kLength];
            int zeros = kLength - numLength;
            System.arraycopy(num, 0, adjustedNum, zeros, numLength);
            num = adjustedNum;
        }

        // carry handling
        List<Integer> result = new ArrayList<>();
        int carry = 0;
        for (int i = num.length - 1; i >= 0; i--) {
            int sum = num[i] + kDigits[i] + carry;
            carry = sum / 10;  
            result.add(sum % 10);  // Store the current digit
        }
        
        
        if (carry > 0) {
            result.add(carry);
        }

        // reverse it
        List<Integer> finalResult = new ArrayList<>();
        for (int i = result.size() - 1; i >= 0; i--) {
            finalResult.add(result.get(i));
        }

        return finalResult;
        }


}
```
## 複雜度
1. 時間複雜度:O(n)
2. 空間複雜度:O(n)

## Approach
1. find Char c's position inside the string
2. create an array for result
3. calculate the shortest distances

## Code
```java
class Solution {
    public int[] shortestToChar(String s, char c) {
    
    //putting char positions into a list
    List <Integer> temp = new ArrayList<>();
    int position = s.indexOf(c);

    while (position != -1){
        temp.add(position);
        position = s.indexOf(c, position + 1);
    }

    // answer array
        int n = s.length();
        int[] result = new int[n];
        
    //Calculate shortest distances
        for (int i = 0; i < n; i++) {
            int minDis = Integer.MAX_VALUE; 
            for (int e : temp) {
                minDis = Math.min(minDis, Math.abs(i - e));
            }
            result[i] = minDis;
        }
        
        return result;

    //testing code
    //int[] tempArray = temp.stream().mapToInt(Integer::intValue).toArray();

        
    }
}
```

## Complexity
1. Time Complexity: O(n*c): iterating over each index and comparing with all positions, c is the number of occurrences of c.
2. Space Complexity: O(n)

## Approach
Using two stack implementing queue, stackOne doing push while stackTwo doing pop and peek, if two stacks are empty, then return empty

## Algorithm
```java
class MyQueue {

        private Stack <Integer> stackOne;
        private Stack <Integer> stackTwo;

    public MyQueue() {
        stackOne = new Stack<Integer>();
        stackTwo = new Stack<Integer>();
    }

    public void push(int x) {
        stackOne.push(x);   
    }

    public int pop() {
        if( stackTwo.isEmpty() ) {
            while ( ! stackOne.isEmpty() ) {
                stackTwo.push ( stackOne.pop() );
            }
        }
        return stackTwo.pop();
    }

    public int peek() {
        if ( stackTwo.isEmpty() ) {
            while( ! stackOne.isEmpty() ) {
                stackTwo.push( stackOne.pop() );
            }
        }
        return stackTwo.peek();

    }

    public boolean empty() {
        if ( stackOne.isEmpty() && stackTwo.isEmpty() ) {
            return true;
        } else{
            return false;
        }

    }
}
