## 思路
从后往前遍历相加，进位
## 代码
```js
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
    // carry 进位
    const res = []
    const len = num.length
    let carry = 0
    for (let i = len - 1; i >= 0; i--) {
        const plus = k % 10
        k = Math.floor(k / 10)
        const temp = num[i] + plus + carry
        if (temp >= 10) {
            carry = 1
        } else {
            carry = 0
        }
        res.unshift(temp % 10)
    }
    // k 还没遍历完
    while (k) {
        const plus = k % 10
        k = Math.floor(k / 10)
        const temp = plus + carry
        if (temp >= 10) {
            carry = 1
        } else {
            carry = 0
        }
        res.unshift(temp % 10)
    }
    if (carry) {
        res.unshift(carry)
    }
    return res
};
```

