## 思路
贪心法
## 代码
```js
/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function(s, c) {
    // 贪心
    // https://leetcode-solution.cn/solutionDetail?type=3&id=2&max_id=2
    
    const res = new Array(s.length)
    // 第一次遍历，从左往右，计算距离
    for (let i = 0; i < s.length; i++) {
        if (s[i] === c) {
            res[i] = 0
        } else {
            res[i] = res[i - 1] === undefined ? Infinity : res[i - 1] + 1 // 如果没有，则与左边最近的一个同步
        }
    }
    
    // 第二次遍历，从右往左
    // 看右侧出现的 C 字符距离更近，就更新 res[i] 距离
    for (let i = s.length - 1; i >= 0; i--) {
        // 只需看是否覆盖
        if (res[i] === Infinity || res[i + 1] + 1 < res[i]) {
            res[i] = res[i + 1] + 1
        }
    }

    return res
};
```
